export default function Navbar() {
const handleScroll = (e, id) => {
e.preventDefault();
document.getElementById(id).scrollIntoView({
behavior: 'smooth'
});
};


return (
<nav className="navbar navbar-expand-lg navbar-dark bg-dark fixed-top shadow">
<div className="container">
<span className="navbar-brand fw-bold">Tesfalem Markos</span>
<ul className="navbar-nav ms-auto flex-row gap-3">
<li className="nav-item">
<a href="#home" className="nav-link" onClick={(e)=>handleScroll(e,'home')}>Home</a>
</li>
<li className="nav-item">
<a href="#about" className="nav-link" onClick={(e)=>handleScroll(e,'about')}>About</a>
</li>
<li className="nav-item">
<a href="#skills" className="nav-link" onClick={(e)=>handleScroll(e,'skills')}>Skills</a>
</li>
<li className="nav-item">
<a href="#projects" className="nav-link" onClick={(e)=>handleScroll(e,'projects')}>Projects</a>
</li>
<li className="nav-item">
<a href="#contact" className="nav-link" onClick={(e)=>handleScroll(e,'contact')}>Contact</a>
</li>
</ul>
</div>
</nav>
);
}```
